import React from 'react';
import '../css/footer.css';

import { Links } from './assets/components/Header';
import { FooterSocial } from './assets/components/Main';
import { Terms } from './assets/components/Footer';

export class Footer extends React.Component {
	render() {
		return (
			<div className="footer-contents">
				<div>
					<Links />
				</div>

				<div>
					<FooterSocial />
				</div>

				<div>
					<Terms />
				</div>
			</div>
		);
	}
}
